import styled from 'styled-components';

const ScalableGrid = styled.div `
    width: ${props=>console.log("s", props)};
    display: grid;
    grid-column-gap: 0;
    grid-template-columns: repeat(10, 1fr);
`;

export {ScalableGrid}
